{
	return vKeyPositions;
}

export function Render()
{
	SendColorPalette();
}

export function Shutdown()
{
	SendColorPalette(true);
}

function SendColorPalette(shutdown = false)
{
	let packet = [];
	packet[0x00] = 0x00;
	packet[0x01] = 0x5a;
	packet[0x02] = 0x3a;
	packet[0x03] = 0x21;
	packet[0x04] = 0x0a;
	packet[0x05] = 0x00;
	packet[0x06] = 0x03;
	packet[0x07] = 0x01;
	packet[0x08] = 0x02;

	 for(let iIdx = 0; iIdx < vKeyPositions.length; iIdx++)
	{
		let iPxX = vKeyPositions[iIdx][0];
		let iPxY = vKeyPositions[iIdx][1];
		let col;
		let offset = 9 + iIdx * 4;

		if(shutdown)
		{
			col = hexToRgb(shutdownColor);
		}
		else if (LightingMode === "Forced")
		{
			col = hexToRgb(forcedColor);
		}
		else
		{
			col = device.color(iPxX, iPxY);
		}

		packet[offset] = 0xFF; //Le magic brightness byte.
		packet[offset + 1] = col[2];
		packet[offset + 2] = col[1];
		packet[offset + 3] = col[0];
	}

	device.write(packet, 65);
}

function hexToRgb(hex)
{
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function Validate(endpoint)
{
	return endpoint.interface === 4;
}

